window.bookSummaryJSON = "<p><b>Audible narration by Janina Gavankar (</b><b><i>True Blood</i></b><b>)</b></p> <p>In the near future, if Vegas games are ingeniously scam-proof, then the heists have to be too, in this imaginative and whip-smart story by the <i>New York Times</i> bestselling author of <i>The Martian</i>.</p> <p>An IT whiz at the Babylon Casino is enlisted to upgrade security for the game of keno and its random-number generator. The new quantum computer system is foolproof. But someone on the inside is no fool. For once the odds may not favor the house - unless human ingenuity isn’t <i>entirely</i> a thing of the past.</p> <p><i>Andy Weir’s Randomize is part of Forward, a collection of six stories of the near and far future from out-of-this-world authors. Each piece can be read or listened to in a single thought-provoking sitting.</i></p>"; 
